import { useState } from 'react';

function Suspense() {

    const [data, setData] = useState(null);

    const handleFetch = () => {
        fetch('/api')
            .then((res) => res.json())
            .then((data) => setData(data));
    };


    return (
        <div>
            <h2>Suspense</h2>
            <button onClick={handleFetch}>Click to Fetch</button>
            <p>{data ? <p>{data.message}</p> : null}</p>
        </div>
    );
}

export default Suspense;
